from math import gcd

def min_removals_to_increase_gcd(n, integers):
    if n <= 2:
        return -1
    m = max(integers) + 1
    prime = [0] * m
    commondivisor = [0] * m

    def seive():
        for i in range(2, m):
            if prime[i] == 0:
                for j in range(i * 2, m, i):
                    prime[j] = i
        for i in range(2, m):
            if not prime[i]:
                prime[i] = i
    gc = integers[0]
    for i in range(1, n):
        gc = gcd(gc, integers[i])
    seive()
    mi = -1
    for i in range(n):
        ele = integers[i] // gc
        while ele > 1:
            div = prime[ele]
            commondivisor[div] += 1
            while ele % div == 0:
                ele //= div
            mi = max(mi, commondivisor[div])
    if mi == -1:
        return -1
    else:
        return n - mi

